import { createRouter, createWebHistory } from 'vue-router'
import HelloWorld from '../components/HomeView.vue'
import AnimeView from '../components/AnimeView.vue'
import MangaView from '../components/MangaView.vue'
import MangaAllView from '../components/MangaAllView.vue'

const routes = [
  {
    path: '/login',
    name: 'login',
  },
  {
    path: '/anime',
    name: 'anime',
    component: HelloWorld
  },
  {
    path: '/anime/:id',
    component: AnimeView
  },
  {
    path: '/manga',
    name: 'manga',
    component: MangaAllView
  },
  {
    path: '/manga/:id',
    component: MangaView
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
